import React from 'react';
import '../styles/AboutPage.css';
import companyHistoryImage from '../assets/company-history.jpg';
import missionVisionImage from '../assets/mission-vision.jpg';
import teamProfilesImage from '../assets/team-profiles.jpg';

const AboutPage = () => {
  return (
    <div className="about-page">
      <h1>About Us</h1>
      <div className="about-section">
        <img src={companyHistoryImage} alt="Company History" />
        <p>Our company was founded with the mission to provide the best services in Dubai...</p>
      </div>
      <div className="about-section">
        <img src={missionVisionImage} alt="Mission and Vision" />
        <p>We aim to be the leaders in our field by adhering to our core values of...</p>
      </div>
      <div className="about-section">
        <img src={teamProfilesImage} alt="Team Profiles" />
        <p>Meet our team of professionals who are dedicated to providing top-notch services...</p>
      </div>
    </div>
  );
};

export default AboutPage;
